// Home.js

import React, { useEffect } from 'react';

function Home() {
  useEffect(() => {
    fetch('http://localhost:3000/posts') // Adjust the URL according to your backend endpoint
      .then((response) => {
        console.log(response.jwo);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Homepage</h1>
    </div>
  );
}

export default Home;
